[{"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "ATP", "limit": 100}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human ATP binding enzyme", "limit": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT DISTINCT ?protein ?proteinName ?ecNumber WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:enzyme ?enzyme ;
           up:recommendedName/up:fullName ?proteinName .
  ?enzyme up:activity ?activity .
  ?activity rdfs:comment ?comment .
  FILTER(CONTAINS(LCASE(?comment), "atp"))
  OPTIONAL { ?enzyme rdfs:label ?ecNumber }
}
LIMIT 50"}}, {"name": "mcp__ols__search", "input": {"query": "ATP kinase enzyme"}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human kinase phosphorylation", "limit": 20}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human ligase ATP", "limit": 20}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human ATPase", "limit": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "ATP dependent enzyme", "pageSize": 20}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "human kinase", "limit": 20}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinLabel ?recommendedName
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:recommendedName ?recName .
  ?recName up:fullName ?recommendedName .

  FILTER(CONTAINS(LCASE(STR(?recommendedName)), "kinase"))

  OPTIONAL { ?protein rdfs:label ?proteinLabel }
}
LIMIT 100
"}}]

[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human membrane transport", "limit": 20}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "uniprot"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "rhea"}}, {"name": "mcp__togomcp__run_sparql", "input": {"endpoint_name": "sib", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT DISTINCT ?protein ?mnemonic ?fullName ?reaction ?equation
WHERE {
  GRAPH <http://sparql.uniprot.org/uniprot> {
    ?protein a up:Protein ;
             up:reviewed 1 ;
             up:organism <http://purl.uniprot.org/taxonomy/9606> ;
             up:mnemonic ?mnemonic ;
             up:enzyme ?enzyme ;
             up:recommendedName ?name ;
             up:annotation ?annot .
    ?name up:fullName ?fullName .
    ?annot rdfs:comment ?function .
    ?function bif:contains "'membrane' AND 'transport'"
  }
  GRAPH <http://rdfportal.org/dataset/rhea> {
    ?reaction rdfs:subClassOf rhea:Reaction ;
              rhea:equation ?equation ;
              rhea:status rhea:Approved ;
              rhea:ec ?enzyme .
  }
}
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"endpoint_name": "sib", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT DISTINCT ?protein ?mnemonic ?fullName ?reaction ?equation
WHERE {
  GRAPH <http://sparql.uniprot.org/uniprot> {
    ?protein a up:Protein ;
             up:reviewed 1 ;
             up:organism <http://purl.uniprot.org/taxonomy/9606> ;
             up:mnemonic ?mnemonic ;
             up:enzyme ?enzyme ;
             up:recommendedName ?name .
    ?name up:fullName ?fullName .
    ?fullName bif:contains "'transport'"
  }
  GRAPH <http://rdfportal.org/dataset/rhea> {
    ?reaction rdfs:subClassOf rhea:Reaction ;
              rhea:equation ?equation ;
              rhea:status rhea:Approved ;
              rhea:ec ?enzyme ;
              rhea:isTransport 1 .
  }
}
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"endpoint_name": "sib", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rhea: <http://rdf.rhea-db.org/>

