}
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"endpoint_name": "sib", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX up: <http://purl.uniprot.org/core/>
