[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
  ?protein a up:Protein ;
           up:reviewed true ;
           up:organism taxon:9606 .
}
"}}]

[{"name": "mcp__ncbi_esearch", "input": {"database": "clinvar", "query": "pathogenic[clinical_significance] AND recent[filter]", "max_results": "20", "sort_by": "date_added"}}, {"name": "mcp__togomcp__list_databases", "input": {}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT ?variant ?label ?accession ?gene_symbol ?significance ?date_created ?num_submitters
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:accession ?accession ;
           cvo:date_created ?date_created ;
           cvo:number_of_submitters ?num_submitters ;
           cvo:record_status "current" .

  OPTIONAL {
    ?variant cvo:classified_record ?classrec .
    ?classrec cvo:classifications ?classifications .
    ?classifications cvo:germline_classification ?germ .
    ?germ cvo:description ?significance .
    FILTER(CONTAINS(LCASE(?significance), "pathogenic"))
  }

  OPTIONAL {
    ?variant cvo:classified_record ?cr .
    ?cr sio:SIO_000628 ?gene_bn .
    ?gene_bn cvo:symbol ?gene_symbol .
  }

  FILTER(?date_created >= "2024-06-01"^^xsd:date)
  FILTER(BOUND(?significance))
}
ORDER BY DESC(?date_created)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT ?variant ?label ?accession ?gene_symbol ?significance ?date_created ?num_submitters
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:accession ?accession ;
           cvo:date_created ?date_created ;
           cvo:number_of_submitters ?num_submitters ;
           cvo:record_status "current" .

  OPTIONAL {
    ?variant cvo:classified_record ?classrec .
    ?classrec cvo:classifications ?classifications .
    ?classifications cvo:germline_classification ?germ .
    ?germ cvo:description ?significance .
  }

  OPTIONAL {
    ?variant cvo:classified_record ?cr .
    ?cr sio:SIO_000628 ?gene_bn .
    ?gene_bn cvo:symbol ?gene_symbol .
  }

  FILTER(?date_created >= "2024-06-01"^^xsd:date)
  FILTER(CONTAINS(LCASE(STR(?significance)), "pathogenic"))
}
ORDER BY DESC(?date_created)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT ?variant ?label ?accession ?gene_symbol ?significance ?date_created ?variation_type
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:accession ?accession ;
           cvo:date_created ?date_created ;
           cvo:variation_type ?variation_type ;
           cvo:record_status "current" .

  OPTIONAL {
    ?variant cvo:classified_record ?classrec .
    ?classrec cvo:classifications ?classifications .
    ?classifications cvo:germline_classification ?germ .
    ?germ cvo:description ?significance .
  }

  OPTIONAL {
    ?variant cvo:classified_record ?cr .
    ?cr sio:SIO_000628 ?gene_bn .
    ?gene_bn cvo:symbol ?gene_symbol .
  }

  FILTER(?date_created >= "2024-09-01"^^xsd:date)
  FILTER(CONTAINS(LCASE(STR(?significance)), "pathogenic"))
  FILTER(!CONTAINS(LCASE(STR(?significance)), "likely"))
}
ORDER BY DESC(?date_created)
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX sio: <http://semanticscience.org/resource/>
PREFIX med2rdf: <http://med2rdf.org/ontology/med2rdf#>

SELECT DISTINCT ?accession ?label ?gene_symbol ?variation_type ?date_created ?disease_name
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  VALUES ?accession { 
    "VCV003900409" "VCV003900457" "VCV003900510" 
    "VCV003900597" "VCV003900614" "VCV003900655"
    "VCV003900656" "VCV003900663" "VCV003900664"
  }

  ?variant cvo:accession ?accession ;
           rdfs:label ?label ;
           cvo:variation_type ?variation_type ;
           cvo:date_created ?date_created .

  OPTIONAL {
    ?variant cvo:classified_record ?cr .
    ?cr sio:SIO_000628 ?gene_bn .
    ?gene_bn cvo:symbol ?gene_symbol .
  }

  OPTIONAL {
    ?variant med2rdf:disease ?disease .
    ?disease cvo:name ?disease_bn .
    ?disease_bn rdfs:label ?disease_name .
  }
}
ORDER BY DESC(?date_created)"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pdb"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "PREFIX pdbx: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT (COUNT(DISTINCT ?entry) as ?count)
FROM <http://rdfportal.org/dataset/pdbj>
WHERE {
  ?entry a pdbx:datablock ;
         pdbx:has_exptlCategory/pdbx:has_exptl ?exptl ;
         pdbx:has_refineCategory/pdbx:has_refine ?refine .

  ?exptl pdbx:exptl.method "X-RAY DIFFRACTION" .
  ?refine pdbx:refine.ls_d_res_high ?resolution .

  FILTER(xsd:decimal(?resolution) > 0 && xsd:decimal(?resolution) < 2.0)
}"}}]
